import React from 'react'
import { CaFoundation, MbaCourses, PgCourses, UgCourses } from './LandingPageData'

export const LandingPage = () => {
  return (
    <div className='BgImage'>
        <div>
            {UgCourses.map((itemsUg) => {
                return(

                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}

            {PgCourses.map((itemsUg) => {
                return(
                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}

            {MbaCourses.map((itemsUg) => {
                return(
                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}

            {CaFoundation.map((itemsUg) => {
                return(
                    <ul>
                        <li>{itemsUg}</li>
                    </ul>
                )
            })}
        </div>
    </div>
  )
}
